import React from 'react';
import { connect } from 'dva';
import {
  Dimensions,
  Keyboard,
  StyleSheet,
} from 'react-native';
import moment from 'moment';
import uuid from 'uuid';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import DailyExpense from './DailyExpense';
import MonthlyExpense from './MonthlyExpense';

const Tab = createMaterialTopTabNavigator();
class RecordPage extends React.PureComponent {
  state = {}
  // Local path to file on the device
  render() {
    const { currentDate, todoList } = this.props;
    console.log("recordPage")
    return (
      <Tab.Navigator>
        <Tab.Screen name="Daily" component={() => <DailyExpense todoList={todoList} />} />
        <Tab.Screen name="Monthly" component={() => <DailyExpense todoList={todoList} />} />
      </Tab.Navigator>
    )
  }
}
export default connect(state => ({
  loading: state.loading,
  effects: state.loading.effects
}))(RecordPage);
